import { plot } from "plotly.js";
import { Card, Container, Button, Col, Row } from "react-bootstrap";
import home_img from "../statics/imgs/home_scrn.jpg"
const Welcome = () => {
    return (
        <div className="bg-primary">
        <Container>
            <Container>
                <div className="d-flex p-2">
                    <Row className="m-auto">
                        
                    <h1 className="text-white">Get a wider angle on coderhub.sa</h1>
                    <div>
                        
                    <h4 className="text-white w-50">Explore coderhub.sa leaderboard data in a better way and gain more insights</h4>
                    </div>
                    </Row>
                </div>
                <br></br>
                <img className="shadow-lg" src={home_img} height={500} width={800}></img>
            </Container>
        </Container>
        </div>
    );
}

export default Welcome;
